function getSpotAt({ line, x }) {
    return line[x % line.length];
}

function followPath({ data, dX, dY }) {
    return data.filter((_, i) => i % dY === 0).map((d, i) => getSpotAt({ line: d, x: dX * i })).join("");
}

function countTrees({ data, dX, dY }) {
    return followPath({data, dX, dY}).split("").filter(c=>c ==="#").length;
}

const slopes = [
    {dX:1, dY:1},
    {dX:3, dY:1},
    {dX:5, dY:1},
    {dX:7, dY:1},
    {dX:1, dY:2},
]

console.log(slopes.map(({dX,dY})=> countTrees({data, dX, dY})).reduce((a,b)=>a*b, 1));